  "2020-06-11T12:24:48",
  "2020-06-11T03:24:48",
  "2020-07-11T17:10:51",
  "コロナチャリティーWEB講演会。名古屋歯科、勉強会。",
  '<p><img src="https://ys-dental.details.co.jp/admin/wp-content/uploads/2020/06/IMG_3979-212x300.jpg" alt="" /></p>\n<p>先日、「我々歯科業界から出来る事を」をいう思いから、企画されたチャリティー講演会にて、パートナーである歯科技工士の鬼頭先生と共にWEB講演を行いました。僕たちのテーマは、「MIコンセプト（なるべく神経やはを削らない）に基づいた審美修復治療」と題して、約１時間お話しさせて頂きました。　内容としては、MIの重要性、ノンプレップベニア（歯を全く削らないセラミック修復）、接着ブリッジ（欠損した部位に隣の歯を削ったり、インプラントを用いずに隣の歯にセラミックの歯を貼り付けつ治療法）、デジタルを用いた審美修復治療についてです。全国から100名を超える歯科医師の先生方に聞いて頂き、僕たち自身としても自分たちの治療を見返すとてもいい機会になりました。この会の収益金は全額、日本赤十字社を通してコロナ関連に寄付されるそうです。まだまだ、予断を許さない状況ですが、我々歯科業界も出来る事を行って行きます。僕たちのような臨床家は、日々診療を行いその結果や過程をフィードバックし、共有し合う事で、結果的に患者さんの治療に活かされていきます。今後も、積極的にこのような活動を続けていこうと思っております。</p>\n',
  "<p>先日、「我々歯科業界から出来る事を」をいう思いから、企画されたチャリティー講演会にて、パートナーである歯科技工士の鬼頭先生と共にWEB講演を行いました。僕たちのテーマは、「MIコンセプト（なるべく神経やはを削らない）に基 [&hellip;]</p>\n",
  "2020.06.10",
  "https://ys-dental.details.co.jp/admin/wp-content/uploads/2020/06/IMG_3979-212x300.jpg",
  '<p>5月から当院でものダーマペン４の導入を始めました。</p>\n<p>歯医者の領域で…と思われる方も多いと思いますが</p>\n<p>口元のアンチエイジングをはじめ、少しでもエイジングケアをより多くの方に</p>\n<p>体験してもらえるよう導入を決めました。</p>\n<p>美容外科やエステなどに興味はあるが、きっかけがないと行けない。</p>\n<p>なんとなく行きづらい。</p>\n<p>なんて方は多いと思います。</p>\n<p>&nbsp;</p>\n<p>特に男性は具体的にどこにいいたらいいのかわからない。</p>\n<p>女性ばかりの多いクリニックに行きにくい。</p>\n<p>など様々ある中で、いつも定期検診してもらっているところ施術ができる。</p>\n<p>歯医者さんへ行く感覚で行ける。</p>\n<p>そのような感覚で男性にも試して頂きたいです。</p>\n<p>&nbsp;</p>\n<p><img src="https://ys-dental.details.co.jp/admin/wp-content/uploads/2020/07/ダーマチラシ-223x300.png" alt="" /></p>\n',
