  "新型コロナウィルス対策について",
  '<p>新型のコロナウィルス拡大にともない、</p>\n<p>皆様に安心して通院いただけるよう当院では以下の取り組みを行っております。</p>\n<p>&nbsp;</p>\n<h2>当院で行っている取り組み</h2>\n<p>定期的に共有スペース(待合室、お手洗い、各診療台および院内)の消毒</p>\n<p>高性能医療用空気清浄機の設置</p>\n<p>当院関係者へマスク着用の義務付け</p>\n<p>当院の従業員に発熱、咳、倦怠感をともなう場合は自宅待機及び専門の医療機関への受診を指示</p>\n<p>世界レベルの滅菌システムで徹底した衛生管理</p>\n<p>いずれも常日頃より行っていることではございますが、より一層細心の注意を払い、皆様の安全確保に注力しております。</p>\n<p>&nbsp;</p>\n<h2>患者様へご協力のお願い</h2>\n<p>患者様におかれましても、<span class="txt_red">発熱・咳・倦怠感がある場合</span>または、</p>\n<p><span class="txt_red">接触者より感染者が確認された場合</span>はご無理なさらずキャンセルのご連絡をいただきますようお願いいたします。</p>\n<p>いずれも患者様の健康、命をお守りするためにスタッフ一同尽力して参ります。</p>\n<p>皆様にはご迷惑おかけし申し訳ございませんが、何卒ご理解とご協力のほどお願い申し上げます。</p>\n<p class="txt_right">医療法人デンタルハート　Y&#8217;sデンタルクリニック　　医院長　吉木　雄一朗</p>\n',
  "<p>新型のコロナウィルス拡大にともない、 皆様に安心して通院いただけるよう当院では以下の取り組みを行っております。 &nbsp; 当院で行っている取り組み 定期的に共有スペース(待合室、お手洗い、各診療台および院内)の消毒  [&hellip;]</p>\n",
